import { useSelector } from "react-redux";
import '../App.css'

const Greeting = () => {

    const message = useSelector(state=> state.message.messages)
    console.log(message)

    return(
        <div className="container">

            {message.map((mes)=> {
                return <p key={mes.id}>{mes.name}</p>
            })}
    </div>
    )
}

export default Greeting;
